import React from "react";

function AdminDashboard() {
  const [activePage, setActivePage] = useState("dashboard");

  const renderPage = () => {
    switch (activePage) {
      case "patients":
        return <Patients />;
      case "doctors":
        return <Doctors />;
      case "prescriptions":
        return <Prescriptions />;
      default:
        return <Dashboard />;
    }
  };
  return <div>AdminDashboard</div>;
}

export default AdminDashboard;
